import "./workPage.css";
import {Work} from '..'
import { useNavigate } from "react-router-dom";



function WorkPage(){

    let navigate = useNavigate(); 
    const routeChangeStuck = () =>{ 
        let path = `./stuck`; 
        navigate(path);
        console.log("click")
      }

    return(
        <section>
            <section className="page-title">
                <p className="page-title-text">My Work</p>
            </section>
            <Work onClick={routeChangeStuck} title='UX Design - STUCK?' imgSrc='./stuck-cover.png' imgID='stuck' description='We designed STUCK?, a mobile application that aims to help users conquer a challenge every day. Users can choose one easy, medium, or difficult challenge from the three choices that STUCK? provides every day, based on how much time or effort they want to dedicate to the challenge.' ></Work>
        </section>
    );
}



export default WorkPage;
